<!DOCTYPE html>
<html lang="jp">
<style>
    .main {
        flex: 1;
    }

    .logo {
        padding-top: 94px;
    }

    .logo img {
        width: 248px;
    }

    .heading h2 {
        font-size: 24px;
        line-height: 1;
        font-weight: 600;
    }

    .heading {
        padding-top: 40px;
    }

    .message {
        padding-top: 40px;
        font-size: 14px;
        line-height: 0.7;
    }

    .icon {
        margin-top: 7px;
    }

    .btn_list {
        display: flex;
        justify-content: center;
        padding-top: 7px;
        font-size: 14px;
        padding-bottom: 220px;
    }

    .apple_btn p {
        margin-bottom: 5px;
        font-size: 12px;
    }

    .android_btn p {
        margin-bottom: 0px;
        font-size: 12px;
    }

    .pc {
        display: inline;
    }

    footer {
        width: 100%;
    }

    .copyright {
        background-color: #fff;
        text-align: center;
        padding-top: 16px;
        padding-bottom: 16px;
    }

    .copyright p {
        font-size: 10px;
        margin-top: 0px;
        margin-bottom: 0px;
    }

    @media screen and (max-width: 800px) {
        .pc {
            display: none;
        }

        .heading h2 {
            font-size: 18px;
            font-weight: 600;
            margin: 0;
            line-height: 1.25;
        }

        .copyright {
            background-color: #fff;
            text-align: left;
            padding-top: 16px;
            padding-bottom: 16px;
            padding-left: 16px;
        }




    }
